import React from 'react'
import ExpenseItem from './ExpenseItem'

function Expenses(props) {
  return (
    <>
    {props.expenses.map((expense,index) => {
      return (

        <ExpenseItem
          key={index}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      )
    })}
  </>
  )
}

export default Expenses
